import views from "../components/views";

const HOME = { component: views.Home, path: "/", isPrivate: false }

const LOGIN = {component: views.Home,
    path: "/login",
    isPrivate: false

}

const CONTACTUS = {
    component: views.Home,
    path: "/contact-us",
    isPrivate: false
}

export default [HOME, LOGIN, CONTACTUS];
